import TableContact from "./Layout/TableContact/TableContact";

const App = () => {
  return (
    <div className="container mt-3">
      <div className="card">
        <div className="card-header">
          <h1>Список контактов</h1>
        </div>
        <div className="card-body">
          <TableContact/>
        </div>
      </div>
    </div>
  );
}

export default App;
